import tasks from "./data.js";

function App() {
  return (
    <div className="container-fluid background">
        <Sidebar/>
        <div className="board">
          <h1>Hi Hyu!</h1>
          <p>
            Welcome back Ryu. We are glad you are here.<br></br>
            Inspire your work, leave your acheivement.
          </p>
          <button type="button" class="btn btn-dark">View your tasks</button>
          <button type="button" class="btn btn-dark">View timeline</button>
        </div>
        <div className="upcoming-tasks">
          <h1 className="upcoming-tasks-title">Upcoming tasks</h1>
          <div>
            <ul>
              {tasks.map((task,index)=>{
                return(
                  <div className="task-list list-border">
                    <div className="deadline list-border">

                    </div>
                    <div className="content list-border">

                    </div>
                    <div className="left-day list-border">

                    </div>
                  </div>
                )
              })}
            </ul>
          </div>
        </div>
    </div>

  );
}

export default App;
